sources.styles\\blocks\\page.scss:
.page {
  font-family: "Inter", sans-serif;
  scroll-behavior: smooth;

  &__body {
    &--with-menu {
      overflow: hidden;
    }
  }

  &__menu {
    position: fixed;
    top: 0;
    left: 0;
    right: 0;

    transform: translateX(-100%);
    transition: transform 0.3s;

    &:target {
      transform: translateX(0);
    }
  }

  &__section {
    margin-bottom: 120px;
  }

  &__section-title {
    margin-bottom: 48px;
    font-weight: 700;
    font-size: 32px;
    line-height: 32px;
    text-align: center;
    letter-spacing: -1.5px;
    color: $color-text-main;

    @include onDesktop {
      margin-bottom: 64px;
      font-size: 48px;
      line-height: 48px;
    }
  }
}

sources.styles\\utils\\_mixins.scss:
@mixin onTablet {
  @media (min-width: 744px) {
    @content;
  }
}

@mixin onDesktop {
  @media (min-width: 1024px) {
    @content;
  }
}

@mixin top-actions {
  display: grid;
  grid-template-columns: 1fr #{$icon-width} #{$icon-width};
  justify-items: start;
  align-items: center;
  gap: 30px;

  @include onTablet {
    grid-template-columns: 1fr 24px 24px;
    gap: 40px;
  }

  @include onDesktop {
    grid-template-columns: 1fr 24px 24px;
    gap: 40px;
  }
}

