sources.styles\\blocks\\header.scss:
.header {
  background-size: cover;
  background-position: center;
  background-repeat: no-repeat;
  background-image: url(../images/header_mobile.png);

  @include onTablet {
    background-image: url(../images/header_tablet.png);
    background-position: top;
  }

  @include onDesktop {
    background-image: url(../images/header_desktop.png);
  }

  &__top {
    @include top-actions;
  }

  &__content {
    display: flex;
    flex-direction: column;
    justify-content: space-between;

    box-sizing: border-box;
    height: 100vh;
    padding: 40px 0 94px;

    @include onDesktop {
      padding-top: 52px;
      padding-bottom: 64px;
    }
  }

  &__title {
    font-size: 32px;
    font-weight: 800;
    font-style: italic;
    line-height: 32px;
    letter-spacing: -1.5px;
    color: #292929;

    @include onDesktop {
      font-size: 48px;
      line-height: 48px;
    }

    &::before {
      content: "";
      display: block;
      width: 32px;
      height: 27px;

      background-image: url(../images/header_wave.svg);
      background-size: cover;
      background-position: center;
      background-repeat: no-repeat;
      margin-bottom: 16px;

      @include onTablet {
        margin-bottom: 40px;

        background-image: url(../images/desktop_waves.svg);
        width: 63px;
        height: 76px;
      }
    }
  }


}

