sources.styles\\blocks\\icon.scss:
.icon {
  position: relative;
  display: block;
  width: 100%;
  padding-bottom: 100%;

  background-size: contain;
  background-position: center;
  background-repeat: no-repeat;

  text-decoration: none;

  &__tooltip {
    position: absolute;
    right: 100%;
    top: 50%;
    transform: translateY(-50%);

    display: block;
    width: max-content;
    padding-right: 12px;

    font-weight: 700;
    font-size: 12px;
    line-height: 16px;
    color: #292929;
    letter-spacing: 2px;
    text-transform: uppercase;

    opacity: 0;
    pointer-events: none;
    transition: opacity 0.3s;
  }

  @include onTablet {
    &:hover &__tooltip {
      opacity: 1;
      pointer-events: all;
    }
  }

  &--menu {
    background-image: url(../images/menu.svg);
    transition: background-image 0.3s;

    &:hover {
      background-image: url(../images/menu_hover.svg);
      width: $icon-width;
    }
  }

  &--phone {
    background-image: url(../images/phone.svg);
  }

  &--cross {
    background-image: url(../images/menu_close.svg);
  }
}

sources.styles\\blocks\\menu.scss:
.menu {
  box-sizing: border-box;
  height: 100vh;
  padding: 40px 0;
  background-color: $themeColor;
  overflow-y: auto;
  z-index: 1;

  @include onTablet {
    padding-top: 52px;
  }

  &__top {
    @include top-actions;
    margin-bottom: 55px;

    @include onDesktop {
      margin-bottom: 80px;
    }
  }

  &__list {
    margin: 0 0 40px;
    padding: 0;
    list-style: none;
  }

  &__item {
    margin-bottom: 24px;

    &:last-child {
      margin-bottom: 0;
    }
  }

  &__link {
    display: inline-block;
    padding-bottom: 8px;
    border-bottom: 1px solid transparent;
    font-weight: 700;
    font-size: 22px;
    line-height: 22px;
    letter-spacing: 2px;
    text-transform: uppercase;
    text-decoration: none;
    color: #{$color-text-main};

    transition: border-color 0.3s;

    &:hover {
      border-color: #{$color-text-main};
    }
  }

  &__call {
    display: block;
    width: max-content;

    font-weight: 700;
    text-transform: uppercase;
    text-decoration: none;
    color: #{$color-text-main};

    &--phone {
      margin-bottom: 16px;

      font-size: 16px;
      line-height: 27px;
    }

    &--action {
      padding-bottom: 8px;
      border-bottom: 1px solid #{$color-text-main};

      font-size: 12px;
      line-height: 16px;
      letter-spacing: 2px;
    }
  }
}

