sources.styles\\blocks\\category.scss:
.category {
  &__photo-container {
    position: relative;

    box-sizing: border-box;
    width: 100%;
    max-height: 320px;
    overflow: hidden;

    &::after {
      content: "";
      display: block;
      padding-bottom: 100%;
    }

    @include onTablet {
      height: 200px;
      padding-bottom: 0;
    }

    @include onDesktop {
      height: 320px;
      padding-bottom: 0;
    }
  }

  &__photo {
    position: absolute;
    width: 100%;
    height: 100%;

    object-fit: cover;
    object-position: center;

    transition: transform 0.3s;

    &:hover {
      transform: scale(110%);
    }
  }

  &__photos {
    margin-bottom: 16px;
  }

  &__title {
    font-weight: 700;
    font-size: 16px;
    line-height: 140%;
    color: $color-text-main;

    @include onDesktop {
      font-size: 24px;
    }
  }
}

sources.styles\\blocks\\button.scss:
.button {
  display: flex;
  justify-content: center;
  align-items: center;
  box-sizing: border-box;
  width: 100%;
  height: 56px;

  font-weight: 700;
  font-size: 16px;
  line-height: 27px;
  text-decoration: none;
  background-color: $color-text-main;
  border-radius: 40px;
  color: #fff;

  cursor: pointer;
  transition: all 0.3s;

  &:hover {
    border: 3px solid $color-text-main;
    background-color: #fff;
    color: $color-text-main;
  }

  &--primary {
    background-color: #fff;
    color: $color-text-main;
  }
}

