sources.styles\\blocks\\form-field.scss:
.form-field {
  box-sizing: border-box;
  display: block;
  width: 100%;
  height: 48px;
  border: 1px solid transparent ;
  border-radius: 40px;
  background-color: #f8f8fa;
  padding: 14px 16px;
  color: $color-text-main;

  transition: all 0.3s;

  &::placeholder {
    font-weight: 400;
    font-size: 14px;
    line-height: 20px;
    color: #7e7e83;
  }

  &:hover {
    border-color: #d5d7de;
  }

  &:hover::placeholder {
    color: $color-text-main;
  }

  &:focus {
    border-color: $color-text-main;
    outline: none;
  }

  &:focus::placeholder {
    color: $color-text-main;
  }

  &--textarea {
    font-family: inherit;
    height: 148px;
    resize: none;
    border-radius: 16px;
  }
}
